import React, { useEffect, useState } from 'react';
import {addMessage} from "../../redux/dialogs_reducer";
import Dialogs from "./Dialogs";
import {connect} from "react-redux";
import {reset} from "redux-form";
import {compose} from "redux";
import {withAuthRedirect} from "../HOC/withAuthRedirect";
import { withRouter } from 'react-router-dom';

const DialogsContainer = (props) => {

    const [userId, setUserId] = useState(props.match.params.userId)

    
    const refreshDialogs = () => {
        let userId = props.match.params.userId;
    }

    useEffect(() => {
        refreshDialogs(props.match.params.userId)
    }, userId)

    return <Dialogs state = {props.state} addMessage = {props.addMessage} reset = {props.reset}/>
}

const mapStateToProps = (state) => {

    return {
        state: state.dialogPage,
        userId: userId
    }
}


export default compose(
    withAuthRedirect,
    connect(mapStateToProps, {addMessage, reset}),
    withRouter
)(DialogsContainer)
